# @lc code=start
class Solution:
    def strStr(self, haystack: str, needle: str) -> int:
        if not needle:
            return 0
        if len(needle)==1:
            for i in range(len(needle)):
                if haystack[i:i+1]==needle:
                    return i
            return -1
        
        next=[0]
        j=0
        i=1
        while i<len(needle):
            if(j==0 or needle[i]==needle[j]):
                i+=1
                j+=1
                next.append(j)
                # next[i]=j
            else:
                j=next[j]
            

        
        nextval=[]
        for i in range(len(next)):
            nextval.append(next[i])
            if needle[i]==needle[next[i]]:
                nextval[i]=next[next[i]]
        
        i=j=0
        print(next)
        while i<len(haystack):
            if haystack[i]==needle[j]:
                if j==len(next)-1:
                    return i-len(nextval)+1
                i+=1
                j+=1
                continue
            if j==0:
                i+=1
            else:
                j=nextval[j]
        return -1
            
test=Solution()
print(test.strStr("mississippi",""))
        
